  constructor(private infractionService:InfractionService) {
    (window as any).pdfMake.vfs = pdfFonts.pdfMake.vfs;

  }
  ngOnInit(): void {

    setTimeout(()=>{
      this.isLoading = false;
    }, 1000);

    this.dtOptions = dtOptions;
    this.fetchData();
  }

  onRemove(id: number) {
    this.infractionService.deleteInfraction(id).subscribe({
      next : rep => console.log(rep),
      error : err => console.error(err)
    });
    this.fetchData();
  }

  fetchData(): void{
    this.infractionService.getAllInfraction().subscribe({
      next: response=>{
        this.infractions = response;
        this.dtTrigger.next(void 0);
        console.log(response);
      },
      error : err => console.error(err)
    })
  }

  /* This method will rerender the table. */
  rerender(): void {
    this.dtElement.dtInstance.then((dtInstance: DataTables.Api) => {
      // Destroy the table first
      dtInstance.destroy();
      // Call the dtTrigger to rerender again
      this.dtTrigger.next(void 0);
    });
  }
